`,IP=xD`
   * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
      font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
   }

   html {
      font-size: 62.5%;
   }

   input {
      font-size: 1.6rem;
      color: #ddd;
      padding: 10px 20px;
      border: 2px solid rgba(0, 0, 0, 0.3);
      background-color: rgba(0, 0, 0, 0.3);
      border-radius: 10px;
      transition: all .3s;
   }

   input:hover,
   input:focus {
      border-color: #4b37d2;
      outline: none;
   }

   button {
      display: flex;
      align-items: flex-end;
      justify-content: center;
      user-select: none;
      gap: 5px;
      cursor: pointer;
      color: #ddd;
      padding: 10px;
      padding-bottom: 15px;
      border: none;
      border-radius: 10px;
      background-color: #4b37d2;
      text-shadow: 0px 1px 1px rgba(0, 0, 0, 0.8);
      box-shadow: 0px -2px 0px 1px rgba(0, 0, 0, 0.3) inset,
      0px 2px 2px 2px rgba(0, 0, 0, 0.3);
      transition: all .2s;
   }
   
   button:hover {
      background-color: #4330bc;      
   }
   
   button:active {
      box-shadow: 0px -1px 0px 1px rgba(0, 0, 0, 0.3) inset,
      0px 0px 2px 0px rgba(0, 0, 0, 0.3);
      transition: none;
      transform: translateY(1px);
   }

   button:disabled {
      pointer-events: none;
      text-shadow: none;
      box-shadow: none;
      filter: grayscale();
   }

   body {
      font-size: 1.6rem;
      color: #ddd;
      text-shadow: 1px 2px 1px #000;
      padding-bottom: 100px;
      background: url(${BP}) no-repeat 103% bottom #242529;
      background-attachment: fixed;
      background-size: 21%;
   }

   @media only screen and (max-width: 1242px) {
      body {
         background-image: none;
      }
   }

   ::-webkit-scrollbar {
      width: 12px;
   }

   ::-webkit-scrollbar-track {
      background: rgba(0, 0, 0, 0.1);
   }

   ::-webkit-scrollbar-thumb {
      background: rgba(0, 0, 0, 0.5);
      border-radius: 12px;
   }

   ::-webkit-scrollbar-thumb:hover {
      background: rgba(0, 0, 0, 0.3);
   }

   @keyframes loading {
      0% {
         background-position: 0% 0%;
      }
      100% {
         background-position: 100% 100%;
      }
   }

   &.--is-loading {
      background: linear-gradient(90deg, rgba(255, 255, 255, 0.1) 20%,  rgba(0, 0, 0, 0.1) 40%,  rgba(255, 255, 255, 0.1) 40%,  rgba(0, 0, 0, 0.1) 30%);
      background-size: 480% 200%;
      animation: loading 2s ease infinite;
   }
